(window.webpackJsonp=window.webpackJsonp||[]).push([[1259],{1615:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-2105-duong-huyen-tai-hien"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-2105-duong-huyen-tai-hien"}},[n._v("#")]),n._v(" Chương 2105: Dương Huyền tái hiện")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Không biết Vương Dĩnh đã phát giác, lúc này Trương Huyền, đang núp ở một cái cao lớn bụi cây từ đó, lặng lẽ hướng về phía trước nhìn lại."),t("br"),t("br"),n._v("Xuất hiện ở trước mắt chính là mấy người trẻ tuổi, mười sáu mười bảy tuổi hình dáng,"),t("br"),t("br"),n._v("Vừa rồi chính là nghe được động tĩnh, mới an bài Vương Dĩnh cẩn thận trốn, chạy tới."),t("br"),t("br"),n._v("Có nam có nữ, từng người đeo bao vây, dọc theo sơn cốc hướng về phía trước đi tới, xem ra đang tìm kiếm cái gì."),t("br"),t("br"),n._v("Liếc mắt nhìn, Trương Huyền sầm mặt lại."),t("br"),t("br"),n._v("Trước mắt hết thảy bảy người, lớn tuổi, chẳng qua mười bảy tuổi khoảng chừng, nhưng một thân lực lượng mạnh mẽ trầm ổn, vậy mà cũng giống như mình, đều là Thần Linh cảnh giới!"),t("br"),t("br"),n._v("Mấu chốt nhất là, sơn cốc gập ghềnh, mấy người này hoàn mỹ thích ứng, xuyên qua trong đó, thật giống cũng không có như vậy mệt nhọc."),t("br"),t("br"),n._v("“Trời sắp tối rồi, ngay ở chỗ này nghỉ ngơi một chút! Ngày mai tìm tới đồ vật, hoàn thành thí luyện, chúng ta liền trở về!” Một người cầm đầu thiếu niên áo trắng nhìn một chút đã rơi về phía tây mặt trời đỏ, mỉm cười, an bài nói."),t("br"),t("br"),n._v("“Tốt!” Nghe được nghỉ ngơi, đám người tất cả đều một mặt vui vẻ, mỗi người đem trên người ba lô gỡ xuống."),t("br"),t("br"),n._v("Có ở chung quanh sắp đặt đặc thù thuốc bột, để muỗi, mặt khác thần thú không đến xâm nhập, có tìm kiếm nguồn nước, có lấy ra ăn bắt đầu chuẩn bị... Mấy người phân công rõ ràng, đâu vào đấy, xem ra, đã tạo thành phối hợp, quen thuộc mỗi người phân công."),t("br"),t("br"),n._v("“Nhất định phải nghĩ phương pháp theo chân bọn họ rời khỏi!”"),t("br"),t("br"),n._v("Thấy những thiếu niên này, thiếu nữ cũng không phát hiện bản thân, Trương Huyền trong lòng suy nghĩ."),t("br"),t("br"),n._v("Cái này không biết là Thần giới cái nào sơn mạch, hầu như không có gì linh khí, đừng nói tu luyện, tấn thăng cấp bậc cao hơn, làm không cẩn thận, đều sẽ chết đói!"),t("br"),t("br"),n._v("Tự mình một người ngược lại cũng thôi, tuỳ ý tìm phương hướng, chỉ cần một mực tiến lên, sớm muộn đều có thể đi ra ngoài, nhưng bây giờ cha mẹ, đệ tử bọn người theo ở phía sau, cũng không dám dễ dàng xuất động!"),t("br"),t("br"),n._v("Đi qua những ngày này dò xét, hắn biết, sơn mạch này mặc dù linh khí vô cùng mỏng manh, nhưng có thần thú đẳng cấp, nhưng là không kém."),t("br"),t("br"),n._v("Tuỳ ý chạy đến một cái, cũng không là đối thủ, mang theo đám người, bảo vệ bọn hắn chu toàn, không có ổn thoả con đường, tuyệt không có khả năng làm được."),t("br"),t("br"),n._v("Ngộ nhỡ đi càng sâu, gặp được cao cấp hơn thần thú, cũng chỉ có thể chờ chết."),t("br"),t("br"),n._v("Bởi vậy, những ngày này một mực điều tra, chính là muốn nhìn một chút có người hay không loại hoạt động tung tích, tìm thích hợp nhất đường đi, hiện tại gặp được, khẳng định không thể để cho bọn họ trực tiếp đi."),t("br"),t("br"),n._v("Chỉ là, thực lực của những người này không yếu, tùy tiện đi vào, đối phương một khi coi hắn là thành kẻ xấu, trực tiếp động thủ, thương thế chưa tốt, lại thêm liên tục ăn hơn mười ngày rau dại, vô cùng suy yếu, chỉ sợ liền năng lực hoàn thủ đều không có."),t("br"),t("br"),n._v("Huống chi..."),t("br"),t("br"),n._v("Minh Lý Chi Nhãn lấp lánh, Trương Huyền nhìn về phía bên ngoài sơn cốc cách nơi này mấy trăm mét địa phương, nhịn không được lắc đầu."),t("br"),t("br"),n._v("Đến nơi này, Minh Lý Chi Nhãn có thể dùng, hơn nữa hiệu quả, vô cùng không tệ."),t("br"),t("br"),n._v("Còn thư viện, trọn vẹn yên lặng nửa tháng, ngày hôm nay mới vừa vặn khôi phục lại, hẳn là tại thích ứng Thần giới Thiên đạo, nghĩ biện pháp giành lấy một phần lực lượng, cho mình sử dụng."),t("br"),t("br"),n._v("Thông qua Minh Lý Chi Nhãn, hắn đã phát giác, đám này thiếu nam, thiếu nữ cũng không phải là một mình tới, đằng sau, đi theo cường giả."),t("br"),t("br"),n._v("Có phải là vì bảo vệ an toàn."),t("br"),t("br"),n._v("Nếu không, những người này trẻ tuổi như vậy, một mình đi vào loại này không có linh khí sơn mạch, người nhà hoặc là lão sư, cũng sẽ không yên tâm."),t("br"),t("br"),n._v("Có cao thủ bảo vệ, cưỡng ép ép hỏi dám chắc được không thông... Nếu có thể nghĩ biện pháp thu hoạch tín nhiệm, theo ở phía sau đi ra sơn mạch tốt nhất, cho dù không có cách nào như vậy, từ trong miệng biết đường đi, hoặc là gần nhất thành trấn vị trí, cũng có thể giải quyết hiện tại khó khăn tình hình."),t("br"),t("br"),n._v("“Nhìn tới, chỉ có thể như vậy...”"),t("br"),t("br"),n._v("Cân nhắc hồi lâu, một cái phương pháp chảy vào trong óc."),t("br"),t("br"),n._v("Nghĩ đến cái này, lặng lẽ lui ra lùm cây, thân thể vụt qua, thay đổi hình dáng."),t("br"),t("br"),n._v("Lạc Nhược Hi cấp cho ngụy trang lệnh bài, ở đây không chỉ có thể sử dụng, hơn nữa hiệu quả không hề yếu, ngụy trang, giống như đúc, Minh Lý Chi Nhãn, đều không thể nhìn thấu."),t("br"),t("br"),n._v("Lúc này hắn ngụy trang bộ dáng, đại khái chừng ba mươi tuổi, cử chỉ văn nhã, nhìn một cái liền cho người ta một loại gần gũi cảm giác, còn tu vi... Sâu không lường được!"),t("br"),t("br"),n._v("Chí ít trước mắt học sinh, không cách nào nhìn thấu."),t("br"),t("br"),n._v("Chuẩn bị sẵn sàng, Trương Huyền lại không che giấu thân hình, nói: “Người phương nào xông vào vào ta địa phương, quấy nhiễu ta thanh tu?”"),t("br"),t("br"),n._v("“Người nào?”"),t("br"),t("br"),n._v("Ngay tại nấu cơm nghỉ ngơi rất nhiều thiếu niên, nghe nói như thế, tất cả đều giật nảy mình, đồng loạt giơ tay lên bên trong vũ khí, hướng âm thanh nguồn gốc nhìn lại."),t("br"),t("br"),n._v("Ngay sau đó nhìn thấy một cái chừng ba mươi tuổi thanh niên, đứng tại thật cao nham thạch bên trên, hai tay chắp sau lưng, gió mạnh bên dưới, vạt áo tung bay, cho người ta một loại, vũ hóa thành tiên cảm giác."),t("br"),t("br"),n._v("Trên mặt lộ ra lãnh ngạo, dường như có nhiều không vui."),t("br"),t("br"),n._v("“Giả thần giả quỷ...” Một cái rất có tư sắc thiếu nữ, tiến về phía trước một bước, vừa định nói chuyện, liền bị phía trước nhất thiếu niên áo trắng chặn lại."),t("br"),t("br"),n._v("“Vị tiền bối này, chúng ta là Dạ Minh thành Dạ Minh học viện học sinh, tới tiến hành thí luyện, không có ý định mạo phạm, mong được tha thứ!”"),t("br"),t("br"),n._v("“Dạ Minh thành? Dạ Minh học viện?”"),t("br"),t("br"),n._v("Ghi xuống, Trương Huyền trên mặt nhưng không có bất kỳ biểu lộ gì, nói: “Ta tới đây, cũng là vì mang học sinh thí luyện!”"),t("br"),t("br"),n._v("“Mang học sinh?” Thiếu niên áo trắng thở phào nhẹ nhõm, trong mắt mang theo nghi hoặc, hỏi: “Không biết lão sư đến từ cái nào học viện?”"),t("br"),t("br"),n._v("Nếu là lão sư, khẳng định cũng không phải là cái gì hung ác hạng người, hẳn là sẽ không lạm sát kẻ vô tội."),t("br"),n._v("“Là chính ta thu mấy cái vụng về học sinh, dẫn bọn hắn tuỳ ý nhìn một chút!” Sợ lộ tẩy, Trương Huyền mập mờ suy đoán."),t("br"),t("br"),n._v("Thấy hắn không nguyện ý nói nhiều, thiếu niên áo trắng không tiện hỏi nhiều, ôm quyền: “Đã nơi này là lão sư ngài tới trước đến, chúng ta lại tìm địa phương khác nghỉ ngơi liền có thể!”"),t("br"),t("br"),n._v("Người trước mắt này, tu vi sâu không lường được, nhãn lực của hắn không cách nào nhìn thấu, đã có kiêng kị."),t("br"),t("br"),n._v("Không có nửa cái bóng người núi hoang, đột nhiên toát ra cái dạng này cường giả, đổi lại người nào, đều sẽ chột dạ."),t("br"),t("br"),n._v("“Không cần, Dạ Minh học viện học sinh, vừa vặn ta và các ngươi viện trưởng cũng coi như quen biết, vừa vặn hỏi thăm một ít chuyện!” Thật vất vả tới người, làm sao có thể để cho bọn họ trực tiếp như vậy rời khỏi, Trương Huyền nói."),t("br"),t("br"),n._v("“Tiền bối quen biết chúng ta viện trưởng?” Thiếu niên áo trắng đồng tử co rụt lại."),t("br"),t("br"),n._v("Viện trưởng thực lực, sâu không lường được, đã đi đến thượng phẩm Thần Linh cảnh giới, trước mắt vị này cùng hắn quen biết, chẳng phải đại biểu tu vi tương đương?"),t("br"),t("br"),n._v("Khó trách không cách nào nhìn thấu, loại thực lực này cường giả, thật muốn động thủ, thực lực của bọn hắn, chỉ sợ không kiên trì được một cái hô hấp, liền sẽ bị đánh chết tại chỗ."),t("br"),t("br"),n._v("Trương Huyền thuận miệng kéo ra đại kỳ, đang định hỏi thăm, đối phương cái gọi là Dạ Minh thành cùng Dạ Minh học viện cụ thể ở nơi nào, cũng tốt mang theo rất nhiều đệ tử đi qua, ngay sau đó một người trung niên âm thanh vang lên: “Nhà ta viện trưởng, một mực bế quan tu hành, bằng hữu ta cơ bản đều biết, cũng không có gì bằng hữu cũ, không biết tiền bối xưng hô như thế nào?”"),t("br"),t("br"),n._v("Âm thanh kết thúc, một cái chừng bốn mươi tuổi trung niên nhân, chạy như bay mà tới, ngăn tại thiếu niên áo trắng trước mặt."),t("br"),t("br"),n._v("Chính là theo ở phía sau bảo vệ đối phương vị cường giả kia."),t("br"),t("br"),n._v("“Lão sư!” Rất nhiều thiếu niên, nhìn người nọ bất ngờ xuất hiện, tất cả đều sững sờ: “Sao ngươi lại tới đây?”"),t("br"),t("br"),n._v("Hiển nhiên, người này một mực theo sau lưng, cũng không để hắn phát hiện."),t("br"),t("br"),n._v("“Các ngươi đi ra thí luyện, với tư cách chủ nhiệm lớp, sao có thể yên tâm bên dưới!” Trung niên nhân cười khổ một tiếng, không nói thêm lời, lần nữa nhìn về phía Trương Huyền, lộ ra nghi ngờ."),t("br"),t("br"),n._v("Hắn đi vào Dạ Minh học viện làm lão sư, đã tiếp cận hai mươi năm, viện trưởng có gì bằng hữu, cơ bản đều biết, chưa từng nghe qua, trước mắt vị này."),t("br"),t("br"),n._v("Ngưng thần tĩnh khí, nhìn kỹ lại, phát hiện lấy thực lực của hắn, vậy mà cũng nhìn không thấu, trước mắt vị này tu vi, trong lòng không chịu được ngạc nhiên."),t("br"),t("br"),n._v("Thực lực của đối phương, chỉ sợ so với viện trưởng đều không hề yếu."),t("br"),t("br"),n._v("“Nhìn ngươi tới, dùng thân pháp, huyệt thái dương nhô lên, tứ bạch huyệt ảm đạm, chứng minh tại tu luyện... Cái này hai bộ công pháp phối hợp lại, quả thực có thể khiến người ta tốc độ như mộng như ảo, nhưng... Ngươi trong tu luyện xuất hiện vấn đề, cả hai chưa hoàn mỹ phù hợp, vì vậy dẫn đến thần lực chảy ngược...”"),t("br"),t("br"),n._v("Trương Huyền mí mắt vừa nhấc: “Không có đoán sai, ngươi hẳn là Dạ Minh học viện Mặc Nguyên lão sư đi!”"),t("br"),t("br"),n._v("“Ngươi... Làm sao biết?”"),t("br"),t("br"),n._v("Trung niên nhân Mặc Nguyên giật nảy mình, con mắt trợn tròn."),t("br"),t("br"),n._v("Hắn tại học viện danh khí không nhỏ, người khác nghe qua tên, xem như bình thường, có thể... Hắn trong tu luyện vấn đề, không phải là có thể hỏi thăm ra tới."),t("br"),t("br"),n._v("Một cái nhìn ra, nhãn lực mạnh mẽ, có thể xưng kinh khủng."),t("br"),t("br"),n._v("Trương Huyền nói: “Ta không chỉ biết những này, còn biết ngươi gần nhất kinh mạch chảy qua Hối Hải huyệt thời điểm, có chút dính nhớp, không chỉ có cửa ải không cách nào thông qua, tu luyện lâu, còn có thể miệng mũi chảy máu, ngực khó chịu!”"),t("br"),t("br"),n._v("“Cái này...” Mặc Nguyên lão sư lần nữa chấn động, tràn đầy khó tin."),t("br"),t("br"),n._v("Nếu như nói, trước đó công pháp, thân pháp, phối hợp không tốt, nhìn thấy bản thân chạy như điên mà tới, tu vi cao có lẽ có thể nhìn ra, tự mình tu luyện bên trong bí ẩn vấn đề, mở miệng nói ra..."),t("br"),t("br"),n._v("Không phải hết sức quen thuộc, vậy cũng chỉ có một loại khả năng..."),t("br"),t("br"),n._v("Thực lực của đối phương, vượt qua bản thân thực sự quá nhiều, thậm chí... Vượt qua viện trưởng!"),t("br"),t("br"),n._v("Chỉ có loại này cường giả, mới có thể một cái nhìn ra công pháp của mình, thân pháp, thậm chí... Trong tu luyện thiếu hụt!"),t("br"),t("br"),n._v("Loại cường giả cấp bậc này, đã nói quen biết viện trưởng, đương nhiên sẽ không tự rơi thân phận nói dối."),t("br"),t("br"),n._v("Có lẽ... Thật sự là viện trưởng bằng hữu."),t("br"),t("br"),n._v("“Ngươi tu luyện là rất nghiêm túc, nhưng cũng tiếc, đi nhầm phương hướng. Minh hải quyết, u minh vào biển, đối hồn phách yêu cầu cực cao, linh hồn của ngươi, rõ ràng không có đi đến loại cảnh giới này, cưỡng ép tăng lên, không có gặp phải phản phệ là tốt lắm rồi!”"),t("br"),t("br"),n._v("Trương Huyền tiếp tục nói."),t("br"),t("br"),n._v("Đối phương vừa rồi xông tới thời điểm, sử dụng võ kỹ, mượn thư viện, lập tức nhìn ra thiếu hụt cùng sơ hở."),t("br"),t("br"),n._v("Dựa theo Khổng sư lời nói tới nói, kèm theo thế giới đẳng cấp càng ngày càng cao, sử dụng thư viện, tạo thành phản phệ cũng liền càng lớn, nhưng bây giờ, muốn thám thính tin tức, thuận lợi rời đi nơi này, nhất định phải sử dụng, không có biện pháp nào khác."),t("br"),t("br"),n._v("Chỉ cần là tu luyện giả, chắc chắn sẽ có sai lầm cùng thiếu hụt, huống chi, tu vi của mình đối phương nhìn không thấu... Hù dọa không khó."),t("br"),t("br"),n._v("“Đa tạ tiền bối chỉ điểm!” Mặc Nguyên lão sư trên đầu mồ hôi lạnh chảy ròng ròng."),t("br"),t("br"),n._v("Trước đó, còn có hoài nghi lời nói, hiện tại tuyệt đối lại không có ý khác."),t("br"),t("br"),n._v("Cùng đối phương nói đồng dạng, thật sự là hắn là bởi vì lực lượng linh hồn không đủ, cưỡng ép tăng lên lực lượng, mới đưa đến tai hoạ ngầm, đến bây giờ đã hình thành ám thương, rất khó khôi phục."),t("br"),t("br"),n._v("“Không biết tiền bối, có thể thuận tiện báo cho xưng hô?” Lại không còn trước đó cao ngạo, Mặc Nguyên lão sư hạ thấp dáng người, một mặt thành khẩn hỏi."),t("br"),t("br"),n._v("“Tại hạ...” Trương Huyền thở phào nhẹ nhõm, đầu lâu có chút nâng lên: “Dương Huyền!”"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-2118"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-2120"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);